    if num_pics % min_len!= 0:
        return '-1'

    # check if enough number of pictures to repost
    if num_pics < num_pics_to_repost:
        return '-1'

    # check if it's possible to repost all pictures
    num_pics_in_seg = num_pics // min_len
    seg_beauties = [0 for _ in range(num_pics_in_seg)]
    for i in range(num_pics_in_seg):
        seg_beauties[i] = beauties[i * min_len]

    # get total beauty of the first segment
    total_beauty = sum(seg_beauties)

    # get the max possible beauty for the first segment
    max_possible = sum(seg_beauties[:num_pics_to_repost])
    if max_possible < total_beauty:
        return '-1'

    # find the max possible beauty of any segment starting at the first segment
    max_beauty = max(seg_beauties[:num_pics_to_repost])
    for i in range(num_pics_in_seg):
        if i > 0:
            if seg_beauties[i] < max_possible:
