            if target % n == 0:
                return n
            if target // n == 1:
                return n
            if target // n < n:
                break

            if i == len(nums) - 1:
                return target

            if i == 0:
                return rec(nums, target - n)

            if rec(nums, target - n)!= 0:
                return n

            if rec(nums, target // n)!= 0:
                return target // n

