    # split on the NSEW characters
    route = stdin.split('NSEW')
    # use a map to track the macro status
    # as we iterate, we only change the status when needed
    mapping = {}
    for move in route:
        for idx in range(0, len(move)):
            # grab the previous status
            old_status = mapping.get(idx)
            # check if the current character is a macro
            if move[idx] == 'M':
                # if we're on a macro, we'll need to make sure we change the macro
                if old_status is None:
                    mapping[idx] = True
                else:
                    mapping[idx] = False
            else:
                # if we're not on a macro, we're allowed to change it
                if old_status is None or old_status is False:
                    mapping[idx] = False

    # iterate over the map
    # once we find a macro, we'll change it to true
    # and continue with the next macro until we hit None
    result = 0
    for key, value in mapping.items():
        if value is True:
            result += 3
        else:
            result += 1

    return result

