class AlternatingSchool(object):
    def __init__(self, votes):
        self.votes = votes
        self.candidates = list(set(self.votes))
        self.candidateCounts = [self.votes.count(c) for c in self.candidates]
        self.simpleMajorityCount = max(self.candidateCounts)

    def solve(self):
        if self.simpleMajorityCount == 0:
            return "Runoff!"
        for i, c in enumerate(self.candidates):
            if self.candidateCounts[i] == self.simpleMajorityCount:
                return c

